var elevatorPosition = 0;
var MAX_CLICKS = 9;
function subirElevador() {
    if (elevatorPosition < MAX_CLICKS) {
        var dz = 0.99;
        for (var i = 88; i <= 110; i++) {
            obj.w[i].z += dz;
        }
        for (var i = 617; i <= 629; i++) {
            obj.w[i].z += dz;
        }
        elevatorPosition++;
        cv.setObj(obj);
        cv.paint();
    }
}
function bajarElevador() {
    if (elevatorPosition > 0) {
        var dz = -0.99;
        for (var i = 88; i <= 110; i++) {
            obj.w[i].z += dz;
        }
        for (var i = 617; i <= 629; i++) {
            obj.w[i].z += dz;
        }
        elevatorPosition--;
        cv.setObj(obj);
        cv.paint();
    }
}
function girarManecillaChicaHoraria() {
    if (!obj || !obj.w[385] || !obj.w[630]) {
        return;
    }
    var af = 5;
    Rota3D.initRotate(obj.w[385], obj.w[630], af * Math.PI / 180);
    obj.w[386] = Rota3D.rotate(obj.w[386]);
    cv.setObj(obj);
    cv.paint();
}
